import { put, fork } from 'redux-saga/effects';
import { GetMaster, getProfile } from './master';
import { getMFBank } from './mfbank';
import { GetBuyRate, GetSellRate } from './goldRate';

export default function* rootSaga() {
    yield fork(GetMaster)
    yield fork(getMFBank)
    yield fork(getProfile)
    yield fork(GetBuyRate)
    yield fork(GetSellRate)
}
